★ 女性はいつでもそれだけで輝ける天使.<br><br>　　その優雅さをイノセントなハ-トで表現しています.ボトル下部のミニハ-トが愛らしさを更にUP. <br><br>★ 無垢な遊び心と内に秘めた情熱.<br><br>　　相反するふたつを体現するのが鮮やかにきわだつ真紅のボトル. <br><br>★ 勝負の前にさっとひと吹き.<br><br>　　その瞬間心地よく広がるスウィ-トな香りがあなたを戦闘モ-ドへ.<br><br>－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－<br>【商品詳細】<br>－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－<br>* 香りの種類 : フル-ティ<br><br>* 香調(ノ-ト) : アプリコット&ピ-チ<br><br>* タイプ : レディ-ス<br><br>* 容量 : 100 ml<br><br>* クラス : EDT<br>－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－<br><style>

