【送料無料】<br><!-- 商品説明 ここから --><div class=cartRap><h3>商品説明</h3><p>★ 花の中で最も柔らかく芳醇な香りを生み出す花蕊（かずい）に着目し、それを見事に組合わせて贅沢なブーケをクリエイト。<br /><br />★ ベースとなるローズの花蕊から抽出された香りはラズベリーのようにピリっとしていてこれまでの『クロエローズ』とは違うフルーティーなトーンを形成そこに繊細なローズを引き立てるバーベナが清涼感を与え、さらにチェリーブロッサムの花蕊から広がるミルキーなアーモンドの香りが全体にコクと丸みをもたらす。<br /><br />★ 原産国：フランス</p></div><!-- 商品説明 ここまで --><!-- 商品仕様 ここから --><div class=cartRap><h3>スペック</h3><p>* 成分:変性アルコール、香料、水、メトキシケイヒ酸エチルヘキシル、リモネン、ヒドロキシシトロネラール、オキシベンゾン-3、サリチル酸エチルヘキシル、ゲラニオール、t-ブチルメトキシジベンゾイルメタン、リナロール、シトラール、シトロネロール、PG、ヘキシルシンナマル、BHT、(アクリレーツ/オクチルアクリルアミド)　コポリマー、加水分解ホホバエステル、黄5、赤504、黄4</p></div><!-- 商品仕様 ここまで --><!-- 広告文責 START --><br /><br />【広告文責】株式会社MOA 03-6631-1126<br />【メーカー】クロエ<br />【区分】海外製・化粧品<br /><br /><img src=http://image.rakuten.co.jp/premoa/cabinet/common/overseas_impinfo.gif><!-- 広告文責 END --><style>

